import React from 'react';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Outline from './outline.png';
import Typed from 'react-typed';


function Home() {

    return(
        <React.Fragment>
            <Container>
                <Row>
                    <Col id="homeText">
                        <span>Hello, I am </span>
                        <span id='name'>Rohan Bawa</span>
                        <span>.</span>
                        <br></br>
                        <span> I am a </span>
                        <Typed strings={['computer science major.', 'bollywood fusion dancer.', 'sports enthusiast.']}
                             typeSpeed={35}
                             backSpeed={15}
                             backDelay={5000}
                             loop
                        />
                    </Col>
                    <Col>
                        <img src={Outline} alt='outline'/>
                    </Col>
                </Row>
            </Container>
        </React.Fragment>
    );

}

export default Home;
